import React, { useState } from "react";
import PieChartComponent from "./PieChartComponent";
import BarChartComponent from "./BarChartComponent";
import LineChartComponent from "./LineChartComponent";
import AgeGroupDetails from "./AgeGroupDetails";
import RouteLineChart from "./RouteLineChart";
import PieChartFood from "./PieChartFood";
import PieChartBeverage from "./PieChartBeverage";
import RouteFilter from "./RouteFilter";
import RouteInsightBox from "./RouteInsightBox";

const Dashboard = () => {
  const [searchRoute, setSearchRoute] = useState("");
  const [showQuarterlyChart, setShowQuarterlyChart] = useState(false);

  const handleSearch = () => {
    if (searchRoute.trim() !== "") {
      setShowQuarterlyChart(true);
    }
  };

  const handleBack = () => {
    setShowQuarterlyChart(false);
    setSearchRoute("");
  };

  return (
    <div style={{ padding: "1rem", background: "linear-gradient(to bottom right, #e0f7fa, #ccffcc)" }}>
      {/* Header with Logo and Title */}
      <div style={{ display: "flex", justifyContent: "space-between", alignItems: "center" }}>
        <div style={{ display: "flex", alignItems: "center", gap: "1rem" }}>
          <img src="/assets/inflight-logo.png" alt="In-Flight Insights Logo" style={{ width: "45px", height: "45px" }} />
          <h1 style={{ fontSize: "1.8rem", color: "#0077cc" }}>‚úàÔ∏è In-Flight Insights Dashboard</h1>
        </div>

        {/* Search Bar */}
        <div style={{ display: "flex", alignItems: "center", gap: "0.5rem" }}>
          <input
            type="text"
            value={searchRoute}
            onChange={(e) => setSearchRoute(e.target.value)}
            placeholder="Enter Flight Route"
            style={{ padding: "8px", borderRadius: "6px", border: "1px solid #ccc" }}
          />
          <button
            onClick={handleSearch}
            style={{ padding: "8px 12px", backgroundColor: "#007BFF", color: "white", border: "none", borderRadius: "6px" }}
          >
            Search
          </button>
          <div style={{ marginLeft: "1rem", display: "flex", gap: "1.5rem" }}>
            <a href="#" style={{ textDecoration: "none", color: "#0077cc", fontWeight: "bold" }}>Dashboard</a>
            <a href="#" style={{ textDecoration: "none", color: "#0077cc", fontWeight: "bold" }}>Reports</a>
            <a href="#" style={{ textDecoration: "none", color: "#0077cc", fontWeight: "bold" }}>Settings</a>
            <a href="#" style={{ textDecoration: "none", color: "#0077cc", fontWeight: "bold" }}>Profile</a>
          </div>
        </div>
      </div>

      {/* KPI Cards */}
      <div style={{ display: "flex", justifyContent: "space-between", marginTop: "1.5rem", gap: "1rem" }}>
        {[
          { label: "üí∞ Cost Savings", value: "$1.2M" },
          { label: "‚ôªÔ∏è Waste Saved", value: "210 kg" },
          { label: "‚úàÔ∏è Routes Analyzed", value: "350" },
          { label: "üåç CO‚ÇÇ Saved", value: "28 tonnes" }
        ].map((kpi, i) => (
          <div
            key={i}
            style={{
              background: "linear-gradient(to right, #e0ffe0, #e0f7ff)",
              flex: 1,
              padding: "1.5rem",
              borderRadius: "12px",
              boxShadow: "0px 2px 6px rgba(0,0,0,0.1)",
              textAlign: "center"
            }}
          >
            <h3 style={{ fontSize: "1.1rem", fontWeight: "600", marginBottom: "0.5rem" }}>{kpi.label}</h3>
            <p style={{ fontSize: "1.5rem", fontWeight: "700" }}>{kpi.value}</p>
          </div>
        ))}
      </div>

      {/* Show Quarterly Chart if Search is Triggered */}
      {showQuarterlyChart && (
        <>
          <RouteFilter route={searchRoute} />
          <div style={{ textAlign: "right", margin: "1rem" }}>
            <button
              onClick={handleBack}
              style={{ padding: "8px 12px", backgroundColor: "#ff4d4d", color: "white", border: "none", borderRadius: "6px" }}
            >
              Back
            </button>
          </div>
        </>
      )}

      {/* Consumption Breakdown + Route Waste Trend */}
      <div style={{ display: "flex", marginTop: "1.5rem", gap: "1rem" }}>
        <div style={{ flex: 1, background: "#f9f9f9", borderRadius: "10px", padding: "1rem" }}>
          <h3 style={{ textAlign: "center", marginBottom: "1rem" }}>Consumption Breakdown</h3>
          <div style={{ display: "flex", justifyContent: "space-around" }}>
            <div>
              <h4 style={{ textAlign: "center" }}>Food</h4>
              <PieChartFood />
            </div>
            <div>
              <h4 style={{ textAlign: "center" }}>Beverages</h4>
              <PieChartBeverage />
            </div>
          </div>
        </div>

        <div style={{ flex: 1 }}>
          <RouteLineChart />
        </div>
      </div>

      {/* Waste by Age Group */}
      <div style={{ marginTop: "2rem" }}>
        <h3>Waste by Age Group</h3>
        <BarChartComponent />
      </div>

      {/* Age Group Details */}
      <div style={{ marginTop: "2rem" }}>
        <h3>Age Group Details</h3>
        <AgeGroupDetails />
      </div>
    </div>
  );
};

export default Dashboard;
